import React from 'react'
import '../component-styles/footer.css'
import { Link } from 'react-router-dom';

function Footer () {

 const socialMediaLinks = [
    { text: 'Facebook', url: 'https://www.facebook.com' },
    { text: 'Twitter', url: 'https://www.twitter.com' },
    { text: 'Instagram', url: 'https://www.instagram.com' },
    { text: 'LinkedIn', url: 'https://www.linkedin.com' },
    { text: 'YouTube', url: 'https://www.youtube.com' },
  ];
  return (
    <div id='footer-main-container'>
      <div id='footer-container'>
        <div id='footer-container-part-one'>
          <div className='part-one-class-container footer-part-one-heading'><h3>Palash Deshmukh</h3></div>
          <div className='part-one-class-container footer-part-one-heading' >
          <ul id='part-one-logo-ul-container'>
        {socialMediaLinks.map((link, index) => (
          <li key={index} className='part-one-li-list-item'>
            <Link to="https://www.google.com" target='_blank'>{link}</Link>
          </li>
        ))}
      </ul>
          </div>
        </div>
        <div id='footer-container-part-two'>


        </div>
      </div>
    </div>
  )
}

export default Footer;
